import React, { useEffect, useState }  from "react";
import { API_URL } from '../../constans/api';

const ListAds = () => {
    const [ads, setAds] = useState();
        useEffect(() => {
            fetch(API_URL)
                .then((res) => res.json())
                .then((json) => json.data)
                .catch((error) => console.error(error))
        }, [])
    return (
        <div>
            <h1>Список объявлений</h1>
            <ul>
                <li></li>
            </ul>
        </div>
    )
}
export default ListAds;
